import React from 'react';
import './SpecialOfferCard.css';

const data = [
  {
    pic: "",
    title: "Pro Program",
    text: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Aspernatur nemo pariatur quia "
  },
  {
    pic: "",
    title: "24/7 Support",
    text: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Aspernatur nemo pariatur quia "
  },
  {
    pic: "",
    title: "Career Planning",
    text: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Aspernatur nemo pariatur quia "
  },
  {
    pic: "",
    title: "Professional Training",
    text: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Aspernatur nemo pariatur quia "
  },
];

const SpecialOfferCard = () => {
  const items = data.map((item, index) => (
    <div key={index}>
      <h4>{item.title}</h4>
      <h5>{item.text}</h5>
    </div>
  ));

  return (
    <div>
      <div className="cardsSection">
        <div className="cardLayout">{items}</div>
      </div>
    </div>
  );
};

export default SpecialOfferCard;
